import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }

  fetchDate = async () => {
    let response = await fetch('https://jsonplaceholder.typicode.com/todos/1');
    console.log(response.json());
  };

  render() {
    return <div></div>;
  }
}

export default App;
